import React from 'react';
import '../Css/Employer.css';
import Logo from '../img/6ef780f9d369a48fbc7f784626780c3e7187d223r1-480-480_hq.gif';

const Employer = () => {
  return (
    <div id="employer">
      <div className="sectionOne">
        <div className="sectionImg"></div>
        <div className="sectionInfo">
          <h1>
            شرایط  <span id="primery">همکاری</span>{' '}
          </h1>
          <ul>
            <li>خانم های بین ۱۸ تا ۳۰ سال</li>
            <li>دارای حداقل مدرک دیپلم</li>
            <li>تسلط به زبان انگلیسی مزیت محسوب می شود</li>
            <li>استخدام از سراسر ایران</li>
          </ul>
        </div>
      </div>
      <div className="sectionTwo">
        <div className="sectionInfo ">
          <div className=" alertex">
            <img src={Logo} alt="exp"></img>
          </div>
          <h1>
            {' '}
            فراخوان <span id="primery">استخدام</span>  
          </h1>
          <p>
          تیم دیلی اسکرایب،با توجه به افزایش حجم پروژه های خود و عقد قراردادهای جدید با شرکت های معتبر خارجی در نظر دارد که کادر خود را تکمیل نماید.به همین روی اقدام به برگذاری دوره های تخصصی آموزشی،کارآموزی و کارآزمایی می کند .
برای اطلاعات بیشتر با ما در ارتباط باشید
          </p>
        </div>
        <div className="sectionImg"></div>
      </div>
    </div>
  );
};

export default Employer;
